import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";

export default function Donations(){
    return(
      <div>
        <Navbar/>
        <div className="mt-10 ml-10 max-w-7xl p-2 bg-white border border-gray-200 rounded-lg shadow dark:bg-gray-800 dark:border-gray-700">
        <a href="#">
          <h5 className="mb-2 text-1xl font-bold tracking-tight text-gray-900 dark:text-white">Omkaar Temple is a Non-Profit Organization and all donations are tax deductible</h5>
        </a>
        <p className="mb-3 font-normal text-gray-700 dark:text-gray-400">
        To establish and build a Hindu Temple in Fort Wayne, IN, USA to worship, conduct religious activities and pursue Hindu tradition and 
        culture. To organize and share religious, cultural, philosophical, yogic, educational and other aspects of Hindu religion and tradition on an ongoing basis for all years to come.
        </p>
      </div>

        <Footer/>
      </div>  
    )
}
